const userDomain = configuration['servicenow.subdomain'];
var contentType =response_headers['Content-Type'];
var respContent="text/html"; 
if (contentType.includes(respContent)){ 
 done({ 
    "response_body":{ 
        "error": "Invalid Domain. Please enter only domain (devxxx), not the full URL" 
    }, 
    "response_status_code": 400 
    }) 
} else if ((userDomain.includes('https://') ||(userDomain.includes('http://')) && userDomain.includes('.service'))) {
    const domain  = userDomain.split('://')[1].split('.service')[0];
    done({
        configuration: {
            'servicenow.subdomain': domain
        }
    });
} 

done();
